class Profile:
    def __init__(self, buckets=25, low=34*8, ideal_s=46*8, hi_s=56*8, ideal_m=66*8, hi_m=80*8, ideal_l=86*8, hi=100*8):
        self.buckets = buckets
        self.low = low
        self.ideal_s = ideal_s
        self.hi_s = hi_s
        self.ideal_m = ideal_m
        self.hi_m = hi_m
        self.ideal_l = ideal_l
        self.hi = hi
